import React, {Fragment} from 'react';

// JSX 需要一个最外层的标签包裹住
// 如果不想用标签包裹，可以使用占位符（Fragment）标签
function TodoList() {
    return (
        <Fragment>
            <input type="text"/>
            <button>
                提交
            </button>
            <ul>
                <li>学英语</li>
                <li>考驾照</li>
            </ul>
        </Fragment>
    );
}

export default TodoList;
